import React from "react";
import { useState, useEffect } from "react";

const BlogChange = () => {
  const [blogs, setBlogs] = useState([]);
  useEffect(() => {
    fetch("../blogs")
      .then((response) => response.json())
      .then((data) => {
        setBlogs(data);
        console.log(data);
      });
  }, []);
  return <div>Blog Change Pages</div>;
};

export default BlogChange;
